import React, { useState } from "react";
import axios from "axios";

export default function Video() {
  let [ready, setReady] = useState(null);
  function handleVideoResponse(response) {
    console.log(response);
    setReady(response);
  }
  function searchVideo() {
    let headers = {
      Authorization: `Bearer ${GoogleApiKey}`,
      Accept: "application/json",
    };

    let youtubeUrl = `https://youtube.googleapis.com/youtube/v3/channels?part=snippet&part=statistics&part=contentDetails&forUsername=moneyrook%2096&key=${GoogleApiKey}`;
    axios.get(youtubeUrl, { headers: headers }).then(handleVideoResponse);
  }

  if (ready) {
    return <div className="YoutubeVideoPlayer">Hello from Youtube Player!</div>;
  } else {
    return searchVideo();
  }
}
